import './App.css';
import React from "react";

import {
  BrowserRouter as Router,
  Switch,
  Routes,
  Route,
  Link
} from "react-router-dom";

import HomePage from './components/HomePage';




function App() {
  return (
    <div className="App">
     <Router>
       <Routes>
         <Route path='/' element={<HomePage />}/>
       </Routes>
     </Router>
    </div>
  );
}

export default App;
